        self.left,self.right = 0,0

    def validate(self, l, r):
        if r < l:
            return False
        while l <= r:
            mid = l + (r - l) // 2
            if self.m[mid] < self.m[r]:
                r = mid - 1
            else:
                l = mid + 1
        return True

    def find(self, r, res):
        if self.m[r] == self.m[r] + 1:
            res.append(self.m[r])
            return
        if not self.validate(r, r - 1):
            return
        self.find(r,res)
        self.find(r + 1,res)

    def find_one(self, res, i):
        if self.m[i] > self.m[i] + 1:
            return
        for i in range(i + 1, self.n):
            if self.m[i] == self.m[i] + 1:
                res.append(self.m[i])
                return

    def pass_down(self):
        res = []
        self.find_one(res, 0)
        return res

