    def solveSudoku(self, board, N, M):
        """
        :type board: List[List[str]]
        :type N: int
        :type M: int
        :rtype: int
        """
        # create a dict of value counts
        valueCount = defaultdict(lambda: 0)
        # create a default dictionary of positions
        positions = defaultdict(lambda: [[0 for _ in range(M)] for _ in range(N)])
        for i in range(N):
            for j in range(N):
                if board[i][j]!= '.':
                    valueCount[board[i][j]] += 1
                    positions[board[i][j]][i][j] = 1
        # print(valueCount)
        # print(positions)

        # run the dfs to find the solution
        ans = 0
        for i in range(N):
            for j in range(N):
                if board[i][j]!= '.':
                    # if a position can be solved
                    if board[i][j] in valueCount:
                        # if a value is not already in the valueCount, add it
                        if valueCount[board[i][j]] == 0:
                            # if a value is already in the valueCount, update it
                            valueCount[board[i][j]] += 1
                            positions[board[i][j]][i][j] = 1
                            ans += 1
                        # if a value is already in the valueCount, remove it
                        elif valueCount[board[i][j]] == 1:
                            # if a value is already in the valueCount, update it
                            valueCount[board[i][j]] -= 1
                            positions[board[i][j]][i][j] = 0
                            ans += 1
        # print(ans)
        return ans

