class Solution:
    def minSteps(self, s: str) -> str:
        n = len(s)
        possible = set(
            'KB'
            'R'
            'B'
            'N'
            '.'
        )
        moves = {'K': (1, 0), 'B': (-1, 0), 'R': (0, 1), 'N': (0, -1)}

        def can_move(p, q):
            return 0 <= q < n and (p + q) in possible and q!= p

        def move(p, q, d):
            if p == n and q == n:
                return 1
            if d == 'K':
                if can_move(p, q):
                    return 1
            if d == 'B':
                if can_move(p, q - 1):
                    return 1
            if d == 'R':
                if can_move(p - 1, q):
                    return 1
            if d == 'N':
                if can_move(p + 1, q):
                    return 1
            return 0

        def solve(p, q, d):
            if d == 'K':
                return move(p, q, d)
            if d == 'B':
                return move(p - 1, q, d)
            if d == 'R':
                return move(p, q + 1, d)
            if d == 'N':
                return move(p + 1, q, d)

        steps = 0
        for i in range(n):
            for j in range(n):
                if s[i] == '.':
                    steps += solve(i, j, s[i])
                if i == j:
                    steps += solve(i, j, 'K')
                if i == j and s[i] == 'K':
                    steps += solve(i, j, 'B')
                if i == j and s[i] == 'B':
                    steps += solve(i, j, 'R')
                if i == j and s[i] == 'N':
                    steps += solve(i, j, 'N')
        return str(steps)

